import React from 'react'
import {Element} from 'react-scroll'
import TopContent from '../TopContent/TopContent'
const TopContainer = () => {
  return (
    <Element name="about" className='topContainer'>
        <TopContent />
    </Element>

  )
}

export default TopContainer
